double correction(int n, int S, double rho){ 
  // cout << n << "," << S << endl;
  // cout << pacbarray[2*  ((n-2)*99 + (S-2))] << "," << pacbarray[2*((n-2)*99 + (S-2)) + 1] << endl;
  //return 1; 
  static double LOG10 = 2.302585;
  if(n<2 || S<2)
    return 1;
  if(n>100) n = 100;
  if(S>100) S = 100;
  //if(rho>0){
  //   std::cout << "corr = " << exp((pacbarray[2*((n-2)*99 + (S-2))]+ pacbarray[2*((n-2)*99 + (S-2)) + 1]*log(rho)/LOG10)) << std::endl;  
//}

//  return 1; // no correction!

  if(rho == 0 )
    return 0;
  else
    return exp(LOG10*(pacbarray[2*((n-2)*99 + (S-2))]+ pacbarray[2*((n-2)*99 + (S-2)) + 1]*log(rho)/LOG10));
// return exp((pacbarray[2*((n-2)*99 + (S-2))]+ pacbarray[2*((n-2)*99 + (S-2)) + 1]*log(rho)/LOG10));
}

double derivcorrection(int n, int S, double rho){ 
  // cout << n << "," << S << endl;
  // cout << pacbarray[2*  ((n-2)*99 + (S-2))] << "," << pacbarray[2*((n-2)*99 + (S-2)) + 1] << endl;
  //return 1; 
  static double LOG10 = 2.302585;
  if(n<2 || S<2)
    return 1;
  if(n>100) n = 100;
  if(S>100) S = 100;
  //if(rho>0){
  //   std::cout << "corr = " << exp((pacbarray[2*((n-2)*99 + (S-2))]+ pacbarray[2*((n-2)*99 + (S-2)) + 1]*log(rho)/LOG10)) << std::endl;  
//}

//  return 1; // no correction!

  if(rho == 0 )
    return 0;
  else
    return (1+pacbarray[2*((n-2)*99 + (S-2)) + 1]) * exp(LOG10*(pacbarray[2*((n-2)*99 + (S-2))]+ pacbarray[2*((n-2)*99 + (S-2)) + 1]*log(rho)/LOG10));
// return exp((pacbarray[2*((n-2)*99 + (S-2))]+ pacbarray[2*((n-2)*99 + (S-2)) + 1]*log(rho)/LOG10));
}
